import React from 'react';

const MyBook = React.forwardRef((props, ref) => {
  const { books } = props;
  const firtsElement = books[0];

  return (
    <div className='demoPage' ref={ref}>
          <h4>Título: {firtsElement.Title}</h4>
          <p>Sinopsis: {firtsElement.Synopsis}</p>
          <p>Autor: {firtsElement.Author}</p>
          <div className='Container'>
            <iframe
              className='Iframe'
              title={firtsElement.Title}
              src={firtsElement.Flipbook}
              allowFullScreen="true"
            ></iframe>
        </div>
    </div>
  );
});

export default MyBook;
